#!/usr/bin/env bash

set -e

# Variables defaults
__disk_path="${DISK_PATH:-/dev/nvme0n1}"
__timezone="${TIMEZONE:-America/Toronto}"
__secure_erase=${SECURE_ERASE:-0}
__machine_name="${MACHINE_NAME:-bubule}"
# __root_password=""
# __user_name=""
# __user_passwd=""


function menu() {
  cat << EOF
#######################
# Arch Linux intaller #
#######################

-d | DISK_PATH          Specify the disk path where to install Arch Linux. Default to /dev/nvme0n1
-t | TIMEZONE           Set the timezone. Default to America/Toronto
-s | SECURE_ERASE       Fill the disk zeros by opening the disk with cryptsetup. Default to false
-n | MACHINE_NAME       Set the machine name. Default to bubule
-r | n/a                Mandatory. Set the root password
-u | n/a                Mandatory. Set the main user name
-p | n/a                Mandatory. Set the main user password
-h | n/a                Show help menu
EOF
}


while getopts 'd:t:s:n:r:u:p:' OPTION; do
  case "${OPTION}" in
    d)
      __disk_path="${OPTARG:-__disk_path}"
      ;;
    t)
      __timezone="${OPTARG:-__timezone}"
      ;;
    s)
      __secure_erase=${OPTARG:-__secure_erase}
      ;;
    n)
      __machine_name="${OPTARG:-__machine_name}"
      ;;
    r)
      __root_password="${OPTARG:-__root_password}"
      ;;
    u)
      __user_name="${OPTARG:-__user_name}"
      ;;
    p)
      __user_passwd="${OPTARG:-__user_passwd}"
      ;;
    h)
      menu && exit 0;
      ;;
    ?)
      menu && exit 1;
      ;;
  esac
done


[[ ${__root_password:-word} == word ]] && echo "Parameter -r (__root_password) not set" && exit 1;
[[ ${__user_name:-word} == word ]] && echo "Parameter -u (__user_name) not set" && exit 1;
[[ ${__user_passwd:-word} == word ]] && echo "Parameter -p (__user_passwd) not set" && exit 1;


# Check if EFI is loaded
[[ ! -d "/sys/firmware/efi/efivars" ]] && exit 1;

# Update system clock
timedatectl set-timezone "${__timezone}"


### Partition disks ###

# If option to erase securely is set
if [[ ${__secure_erase} == 1 ]]; then
  cryptsetup open --type plain "${__disk_path}" container --key-file /dev/urandom
  dd if=/dev/zero of=/dev/mapper/container status=progress bs=1M
  cryptsetup close container
fi

# If not erase securely then just erase partition table
sgdisk --zap-all "${__disk_path}"

# Partition
sgdisk --clear \
  --new=1:0:+512MiB \
  --typecode=1:ef00 \
  --change-name=1:EFI \
  \
  --new=2:0:0 \
  --typecode=2:8300 \
  --change-name=2:cryptsystem \
  \
  "${__disk_path}"

# Encrypt container
cryptsetup luksFormat --type luks2 --cipher serpent-xts-plain64 --key-size 512 /dev/disk/by-partlabel/cryptsystem
cryptsetup open --type luks2 /dev/disk/by-partlabel/cryptsystem system

# BTRFS
mkfs.btrfs --label system /dev/mapper/system
mount --types btrfs LABEL=system /mnt
btrfs subvolume create /mnt/@root
btrfs subvolume create /mnt/@home
btrfs subvolume create /mnt/@var_log
btrfs subvolume create /mnt/@swap
btrfs subvolume create /mnt/@tmp
btrfs subvolume create /mnt/@snapshots

umount --recursive /mnt

# EFI
mkfs.fat -F32 -n EFI /dev/disk/by-partlabel/EFI

# Mount filesystem
mount \
  --types btrfs \
  --options defaults,x-mount.mkdir,compress=zstd,ssd,noatime,subvol=@root \
  LABEL=system \
  /mnt
mount \
  --types btrfs \
  --options defaults,x-mount.mkdir,compress=zstd,ssd,noatime,subvol=@home \
  LABEL=system \
  /mnt/home
mount \
  --types btrfs \
  --options defaults,x-mount.mkdir,compress=zstd,ssd,noatime,subvol=@var_log \
  LABEL=system \
  /mnt/var/log
mount \
  --types btrfs \
  --options defaults,x-mount.mkdir,compress=zstd,ssd,noatime,subvol=@swap \
  LABEL=system \
  /mnt/swap
mount \
  --types btrfs \
  --options defaults,x-mount.mkdir,compress=zstd,ssd,noatime,subvol=@tmp \
  LABEL=system \
  /mnt/tmp
mount \
  --types btrfs \
  --options defaults,x-mount.mkdir,compress=zstd,ssd,noatime,subvol=@snapshots \
  LABEL=system \
  /mnt/.snapshots
mkdir /mnt/boot
mount LABEL=EFI /mnt/boot

# Create swapfile
btrfs filesystem mkswapfile --size 16G /mnt/swap/swapfile
swapon /mnt/swap/swapfile
__swapfile_offset=$(btrfs inspect-internal map-swapfile --resume-offset /mnt/swap/swapfile)

# Set pacman
sed -i 's/^#ParallelDownloads.*/ParallelDownloads = 20/g' /etc/pacman.conf
reflector \
  --latest 5 \
  --protocol https \
  --country Canada \
  --sort rate \
  --save /etc/pacman.d/mirrorlist

cat << EOD >> "/etc/pacman.conf"

[community]
Include = /etc/pacman.d/mirrorlist
EOD

# see: https://bbs.archlinux.org/viewtopic.php?pid=2081392#p2081392
while ! systemctl show pacman-init.service | grep SubState=exited; do
  systemctl --no-pager status -n0 pacman-init.service || true
  sleep 1
done

pacman -Sy
pacman --sync --noconfirm archlinux-keyring
pacman-key --init
pacman-key --populate

# Install base
pacstrap -K /mnt \
  base \
  base-devel \
  btrfs-progs \
  dosfstools \
  exfat-utils \
  e2fsprogs \
  git \
  intel-ucode \
  iwd \
  libva \
  linux \
  linux-firmware \
  linux-headers \
  man-db \
  man-pages \
  neovim \
  nvidia \
  pacman-contrib \
  qt5ct \
  qt5-wayland \
  qt6-wayland \
  sudo \
  systemd \
  texinfo \
  zsh \
  zsh-completions \
  zstd

# TODO install and check snapper for snapshots
# see: https://www.codyhou.com/arch-encrypt-swap/
# see: https://wiki.archlinux.org/title/Snapper

# Generate fstab
genfstab -L /mnt >> /mnt/etc/fstab

# Arch-chroot
arch-chroot /mnt bash -se << EOF
  ln --symbolic --force "/usr/share/zoneinfo/${__timezone}" /etc/localtime
  hwclock --systohc
  # TODO: Get an error as systemd is not ready to be used or something like that. Find a way to set NTP to true
  #timedatectl set-ntp true
  
  # Generate locales
  sed -i 's/#en_US.UTF-8 UTF-8/en_US.UTF-8 UTF-8/g' /etc/locale.gen
  echo "LANG=en_US.UTF-8" > /etc/locale.conf
  locale-gen

  echo "${__machine_name}" > /etc/hostname
  cat << EOD >/etc/hosts
127.0.0.1         localhost
::1               localhost
127.0.1.1         ${__machine_name}
EOD

  echo 'root:${__root_password}' | chpasswd
  useradd \
    --groups wheel,audio,video,storage,disk \
    --create-home \
    --shell /bin/zsh \
    --user-group \
    ${__user_name}
  echo '${__user_name}:${__user_passwd}' | chpasswd
  sed -i 's/# %wheel ALL=(ALL:ALL) NOPASSWD: ALL/%wheel ALL=(ALL:ALL) NOPASSWD: ALL/g' /etc/sudoers

  sed -i 's/^MODULES=()/MODULES=(nvidia nvidia_modeset nvidia_uvm nvidia_drm)/g' /etc/mkinitcpio.conf
  sed -i 's/^HOOKS=(\(.*\) \(kms\) \(.*\) filesystems\(.*\))/HOOKS=(\1 \3 encrypt btrfs filesystems\4 resume)/g' /etc/mkinitcpio.conf
  mkinitcpio --preset linux
  bootctl --path=/boot install

  cat << EOD > /etc/modprobe.d/nvidia.conf
options nvidia-drm modeset=1
EOD

  cat << EOD > /boot/loader/entries/arch.conf
title Arch Linux
linux /vmlinuz-linux
initrd /intel-ucode.img
initrd /initramfs-linux.img
options cryptdevice=PARTLABEL=cryptsystem:system:allow-discards root=/dev/mapper/system rootflags=subvol=@root rd.luks.options=discard rw resume=/dev/mapper/system resume_offset=${__swapfile_offset} nvidia_drm.modeset=1
EOD

  cat << EOD >> /boot/loader/loader.conf
default arch.conf
timeout 5
console-mode max
editor no
EOD

  echo "DNS=1.1.1.2 1.0.0.2" >> /etc/systemd/resolved.conf
  systemctl enable systemd-resolved

  mkdir -p /etc/iwd
  cat << EOD > /etc/iwd/main.conf
[General]
EnableNetworkConfiguration=True

[Network]
NameResolvingService=systemd
EOD

  mkdir -p /etc/pacman.d/hooks
  cat << EOD > /etc/pacman.d/hooks/nvidia.hook
[Trigger]
Operation=Install
Operation=Upgrade
Operation=Remove
Type=Package
Target=nvidia
Target=linux

[Action]
Description=Update NVIDIA module in initcpio
Depends=mkinitcpio
When=PostTransaction
NeedsTargets
Exec=/bin/sh -c 'while read -r trg; do case $trg in linux) exit 0; esac; done; /usr/bin/mkinitcpio -p linux'
EOD

  systemctl enable iwd.service
  systemctl enable systemd-boot-update.service

  sed -i 's/^#ParallelDownloads.*/ParallelDownloads = 20/g' /etc/pacman.conf

  touch "/home/${__user_name}/.zshrc"
  chown ${__user_name}:${__user_name} "/home/${__user_name}/.zshrc" 

  # Install yay
  sudo --login --user=${__user_name}  bash << EOD
git clone https://aur.archlinux.org/yay.git "/home/${__user_name}/yay"
cd "/home/${__user_name}/yay"
makepkg --syncdeps --install --noconfirm
yay -Syu \
  --answerclean=All \
  --answerdiff=None \
  --answerupgrade=None \
  --nodiffmenu \
  --noeditmenu \
  --removemake \
  --cleanafter \
  \
  --noconfirm \
  --needed \
    breeze-icons \
    dolphin \
    firefox \
    gst-plugin-pipewire \
    hyprland-nvidia \
    hyprpaper \
    kitty \
    nvidia-vaapi-driver-git \
    pipewire \
    pipewire-alsa \
    pipewire-audio \
    pipewire-docs \
    pipewire-jack \
    pipewire-pulse \
    swaylock-effects-git \
    ttf-nerd-fonts-symbols \
    vscodium-bin \
    waybar \
    wireplumber \
    wofi \
    \
    gnu-free-fonts \
    phonon-qt5-gstreamer
EOD

  # Create Hyprpaper config file with an image
  mkdir -p "/home/${__user_name}/.config/hypr"

  echo -n '' | base64 -d - > "/home/${__user_name}/.config/hypr/example.jpg"

  cat << EOD > "/home/${__user_name}/.config/hypr/hyprpaper.conf"
preload = /home/${__user_name}/.config/hypr/example.jpg
wallpaper = , /home/${__user_name}/.config/hypr/example.jpg

EOD

  # Create Hyprland config file
  mkdir -p "/home/${__user_name}/.config/hypr"
  cat << "EOD" > "/home/${__user_name}/.config/hypr/hyprland.conf"

########################################################################################
AUTOGENERATED HYPR CONFIG.
PLEASE USE THE CONFIG PROVIDED IN THE GIT REPO /examples/hypr.conf AND EDIT IT,
OR EDIT THIS ONE ACCORDING TO THE WIKI INSTRUCTIONS.
########################################################################################

#
# Please note not all available settings / options are set here.
# For a full list, see the wiki
#

#autogenerated = 1 # remove this line to remove the warning

# See https://wiki.hyprland.org/Configuring/Monitors/
monitor=,highres,auto,1


# See https://wiki.hyprland.org/Configuring/Keywords/ for more

# Execute your favorite apps at launch
# exec-once = waybar & hyprpaper & firefox
exec-once = waybar & hyprpaper

# Source a file (multi-file configs)
# source = ~/.config/hypr/myColors.conf

# Some default env vars.
env = XCURSOR_SIZE,24

# For all categories, see https://wiki.hyprland.org/Configuring/Variables/
input {
    kb_layout = us
    kb_variant =
    kb_model =
    kb_options =
    kb_rules =

    follow_mouse = 1

    touchpad {
        natural_scroll = no
    }

    sensitivity = 0 # -1.0 - 1.0, 0 means no modification.
}

general {
    # See https://wiki.hyprland.org/Configuring/Variables/ for more

    gaps_in = 3
    gaps_out = 5
    border_size = 1
    col.active_border = rgba(33ccffee) rgba(00ff99ee) 45deg
    col.inactive_border = rgba(595959aa)
    cursor_inactive_timeout = 3

    layout = dwindle
}

decoration {
    # See https://wiki.hyprland.org/Configuring/Variables/ for more

    rounding = 5
    blur = yes
    blur_size = 3
    blur_passes = 1
    blur_new_optimizations = on

    drop_shadow = yes
    shadow_range = 4
    shadow_render_power = 3
    col.shadow = rgba(1a1a1aee)
}

animations {
    enabled = yes

    # Some default animations, see https://wiki.hyprland.org/Configuring/Animations/ for more

    bezier = myBezier, 0.05, 0.9, 0.1, 1.05

    animation = windows, 1, 7, myBezier
    animation = windowsOut, 1, 7, default, popin 80%
    animation = border, 1, 10, default
    animation = borderangle, 1, 8, default
    animation = fade, 1, 7, default
    animation = workspaces, 1, 6, default
}

dwindle {
    # See https://wiki.hyprland.org/Configuring/Dwindle-Layout/ for more
    pseudotile = yes # master switch for pseudotiling. Enabling is bound to mainMod + P in the keybinds section below
    preserve_split = yes # you probably want this
}

master {
    # See https://wiki.hyprland.org/Configuring/Master-Layout/ for more
    new_is_master = true
}

gestures {
    # See https://wiki.hyprland.org/Configuring/Variables/ for more
    workspace_swipe = off
}

# Example per-device config
# See https://wiki.hyprland.org/Configuring/Keywords/#executing for more
device:epic-mouse-v1 {
    sensitivity = -0.5
}

binds {
    pass_mouse_when_bound = true
}

# Example windowrule v1
# windowrule = float, ^(kitty)$
# Example windowrule v2
# windowrulev2 = float,class:^(kitty)$,title:^(kitty)$
# See https://wiki.hyprland.org/Configuring/Window-Rules/ for more


# See https://wiki.hyprland.org/Configuring/Keywords/ for more
\$mainMod = SUPER

# Example binds, see https://wiki.hyprland.org/Configuring/Binds/ for more
bind = \$mainMod, Q, exec, kitty
bind = \$mainMod, C, killactive, 
bind = \$mainMod, M, exit, 
bind = \$mainMod, E, exec, dolphin
bind = \$mainMod, V, togglefloating, 
bind = \$mainMod, R, exec, wofi --show drun
bind = \$mainMod, P, pseudo, # dwindle
bind = \$mainMod, J, togglesplit, # dwindle
bind = \$mainMod, F, exec, firefox
bind = \$mainMod, A, exec, vscodium

# Move focus with mainMod + arrow keys
bind = \$mainMod, left, movefocus, l
bind = \$mainMod, right, movefocus, r
bind = \$mainMod, up, movefocus, u
bind = \$mainMod, down, movefocus, d

# Switch workspaces with mainMod + [0-9]
bind = \$mainMod, 1, workspace, 1
bind = \$mainMod, 2, workspace, 2
bind = \$mainMod, 3, workspace, 3
bind = \$mainMod, 4, workspace, 4
bind = \$mainMod, 5, workspace, 5
bind = \$mainMod, 6, workspace, 6
bind = \$mainMod, 7, workspace, 7
bind = \$mainMod, 8, workspace, 8
bind = \$mainMod, 9, workspace, 9
bind = \$mainMod, 0, workspace, 10

# Move active window to a workspace with mainMod + SHIFT + [0-9]
bind = \$mainMod SHIFT, 1, movetoworkspace, 1
bind = \$mainMod SHIFT, 2, movetoworkspace, 2
bind = \$mainMod SHIFT, 3, movetoworkspace, 3
bind = \$mainMod SHIFT, 4, movetoworkspace, 4
bind = \$mainMod SHIFT, 5, movetoworkspace, 5
bind = \$mainMod SHIFT, 6, movetoworkspace, 6
bind = \$mainMod SHIFT, 7, movetoworkspace, 7
bind = \$mainMod SHIFT, 8, movetoworkspace, 8
bind = \$mainMod SHIFT, 9, movetoworkspace, 9
bind = \$mainMod SHIFT, 0, movetoworkspace, 10

# Scroll through existing workspaces with mainMod + scroll
bind = \$mainMod, mouse_down, workspace, e+1
bind = \$mainMod, mouse_up, workspace, e-1

# Move/resize windows with mainMod + LMB/RMB and dragging
bindm = \$mainMod, mouse:272, movewindow
bindm = \$mainMod, mouse:273, resizewindow

bind = \$mainMod SHIFT, up, resizeactive, 0 -10
bind = \$mainMod SHIFT, down, resizeactive, 0 10
bind = \$mainMod SHIFT, left, resizeactive, -10 0
bind = \$mainMod SHIFT, right, resizeactive, 10 0

env = LIBVA_DRIVER_NAME,nvidia
env = XDG_SESSION_TYPE,wayland
#env = GBM_BACKEND,nvidia-drm
env = __GLX_VENDOR_LIBRARY_NAME,nvidia
env = WLR_NO_HARWARE_CURSORS,1

EOD
  chown -R ${__user_name}:${__user_name} "/home/${__user_name}/.config"
  sed -i 's/^%wheel ALL=(ALL:ALL) NOPASSWD: ALL/# %wheel ALL=(ALL:ALL) NOPASSWD: ALL/g' /etc/sudoers
  sed -i 's/# %wheel ALL=(ALL:ALL) ALL/%wheel ALL=(ALL:ALL) ALL/g' /etc/sudoers

EOF

swapoff /mnt/swap/swapfile
umount --recursive /mnt
cryptsetup close system

echo "Ready to reboot! Don't forget to remove the usb key"
